import API from '../API';
import { useEffect } from 'react';
import { Button, Spacer, CallFilled } from '@aircall/tractor';

import AppStyling from '../AppStyling';

import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(AppStyling);

const CallList = ({ token, page }) => {
  const classes = useStyles();

  useEffect(() => {
    API.getCalls(token, page)
      .then(resp => resp.json())
      .then(data => console.log(data));
  });

  return (
    <Spacer space="s" width="400px !important" direction="vertical">
      {displayCalls()}
    </Spacer>
  );
};

const displayCalls = () => {
  return (
    <Button>
      <CallFilled />
      Left Icon
    </Button>
  );
};

export default CallList;
